// client/src/App.tsx - Test version with Tailwind classes
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useLocation } from 'react-router-dom';

// Simple test component to verify Tailwind is working
const TailwindTest = () => (
  <div className="min-h-screen bg-gray-50 p-8">
    <div className="max-w-4xl mx-auto">
      <h1 className="text-4xl font-bold text-center mb-8 text-blue-600">
        🎯 Tailwind CSS Test
      </h1>

      <div className="bg-white p-8 rounded-lg shadow-md">
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-6">
          <div className="bg-blue-100 border border-blue-300 p-4 rounded">
            <h3 className="text-blue-800 font-semibold">Blue Card</h3>
            <p className="text-blue-600 text-sm">This should be blue styled</p>
          </div>

          <div className="bg-green-100 border border-green-300 p-4 rounded">
            <h3 className="text-green-800 font-semibold">Green Card</h3>
            <p className="text-green-600 text-sm">This should be green styled</p>
          </div>

          <div className="bg-purple-100 border border-purple-300 p-4 rounded">
            <h3 className="text-purple-800 font-semibold">Purple Card</h3>
            <p className="text-purple-600 text-sm">This should be purple styled</p>
          </div>
        </div>

        <div className="bg-yellow-100 border-l-4 border-yellow-500 p-4 rounded">
          <h4 className="text-yellow-800 font-bold">Tailwind Status Check</h4>
          <p className="text-yellow-700">
            If you can see colors and proper spacing, Tailwind CSS is working! 🎉
          </p>
        </div>

        <div className="mt-6 flex justify-center">
          <button className="bg-blue-600 hover:bg-blue-700 text-white font-semibold py-2 px-4 rounded transition-colors">
            Test Button (should be blue with hover effect)
          </button>
        </div>
      </div>
    </div>
  </div>
);

// Navigation component
const Navigation = () => {
  const location = useLocation();

  const navItems = [
    { path: '/', label: '🧪 Tailwind Test' },
    { path: '/components', label: '📱 Your Components' },
  ];

  return (
    <nav className="bg-blue-800 text-white p-4 mb-8">
      <div className="max-w-6xl mx-auto flex gap-4">
        {navItems.map(item => (
          <Link
            key={item.path}
            to={item.path}
            className={`px-4 py-2 rounded transition-colors ${
              location.pathname === item.path 
                ? 'bg-blue-600 text-yellow-300 font-bold' 
                : 'hover:bg-blue-700'
            }`}
          >
            {item.label}
          </Link>
        ))}
      </div>
    </nav>
  );
};

// Your existing components page
const ComponentsPage = () => (
  <div className="min-h-screen bg-gray-50">
    <div className="max-w-6xl mx-auto p-8">
      <h1 className="text-3xl font-bold text-center mb-8 text-gray-900">
        Your FundRaisely Components
      </h1>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        <Link to="/register" className="bg-white p-6 rounded-lg shadow-md hover:shadow-lg transition-shadow border border-gray-200 block">
          <h3 className="text-xl font-semibold text-blue-600 mb-2">📝 Club Registration</h3>
          <p className="text-gray-600">Complete registration form with validation</p>
        </Link>

        <Link to="/dashboard" className="bg-white p-6 rounded-lg shadow-md hover:shadow-lg transition-shadow border border-gray-200 block">
          <h3 className="text-xl font-semibold text-green-600 mb-2">📊 Dashboard</h3>
          <p className="text-gray-600">Full dashboard with metrics and tabs</p>
        </Link>

        <Link to="/create-event" className="bg-white p-6 rounded-lg shadow-md hover:shadow-lg transition-shadow border border-gray-200 block">
          <h3 className="text-xl font-semibold text-yellow-600 mb-2">📅 Create Event</h3>
          <p className="text-gray-600">Event creation with flexible types</p>
        </Link>
      </div>
    </div>
  </div>
);

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-50">
        <Navigation />

        <Routes>
          <Route path="/" element={<TailwindTest />} />
          <Route path="/components" element={<ComponentsPage />} />

          {/* Add your other routes here once Tailwind is confirmed working */}
          <Route path="/register" element={
            <div className="p-8">
              <div className="text-center">
                <h2 className="text-2xl font-bold mb-4">Registration Component</h2>
                <p className="text-gray-600">Your ClubRegistrationForm would go here</p>
              </div>
            </div>
          } />

          <Route path="/dashboard" element={
            <div className="p-8">
              <div className="text-center">
                <h2 className="text-2xl font-bold mb-4">Dashboard Component</h2>
                <p className="text-gray-600">Your ClubDashboard would go here</p>
              </div>
            </div>
          } />

          <Route path="/create-event" element={
            <div className="p-8">
              <div className="text-center">
                <h2 className="text-2xl font-bold mb-4">Create Event Component</h2>
                <p className="text-gray-600">Your CreateEventForm would go here</p>
              </div>
            </div>
          } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
